import React from "react";
import icon from "../../../assets/icon.svg";
import {
  faConciergeBell,
  faStar,
  faEnvelope
} from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import './Header.scss';
import RestaurantStar from './RestauRating'
import Discount from './Discount'



class Head extends React.Component {
  render() {
    return (
      <div className="menu-head">
        <img src={icon} alt="restaurant logo" className="restaulogo" height="100" width="100" />
        <div className="menu-head-content">
          <h1 className="restaurant-title">AJEGUNLE FINEST CHAO!</h1>
          <p className="restau-info">
            {" "}
            <FontAwesomeIcon color="#d6db46" icon={faConciergeBell} /> All Local
            and International Dishes
          </p>
          < RestaurantStar/>
          <p className="devlivery-fee">Delivery fee: #400</p>
          <p className="">Min Order: #500 Max Order: #700</p>
       

        <div className="menu-links">
            <div className="menu-link">
          <a href="#"className="link" >
            <FontAwesomeIcon icon={faEnvelope} /> Message Restaurant
          </a>
          </div>
          <div className="menu-link__two">
          <a href="#" className="link">Visit site</a> </div>
        </div>
        </div>

<Discount/>


      </div>
    );
  }
}

export default Head;
